(69, 121, '<div><div>Minimum qualifications:</div><ul style="box-sizing: inherit; padding-left: 30px; margin-top: 0px; margin-bottom: 32px; color: rgb(46, 49, 52); font-family: Roboto, Arial, Helvetica, sans-serif; letter-spacing: 0.2px; outline: 0px !important;"><li style="box-sizing: inherit; outline: 0px !important; text-indent: -17px;">Bachelor\'s degree in Computer Science, Electrical Engineering, a related technical field, or equivalent practical experience.</li><li style="box-sizing: inherit; outline: 0px !important; text-indent: -17px;">Experience as a Technical (Pre)Sales Engineer in a Cloud Computing or B2B software company.</li><li style="box-sizing: inherit; outline: 0px !important; text-indent: -17px;">Experience in traditional datacenter architectures and components.</li><li style="box-sizing: inherit; outline: 0px !important; text-indent: -17px;">Experience in at least one of the following: cloud migration, disaster recovery; application/servers assessment and discovery.</li></ul><div>Preferred qualifications:</div><ul style="box-sizing: inherit; padding-left: 30px; margin-top: 0px; color: rgb(46, 49, 52); font-family: Roboto, Arial, Helvetica, sans-serif; letter-spacing: 0.2px; outline: 0px !important;"><li style="box-sizing: inherit; outline: 0px !important; text-indent: -17px;">Masters degree in Computer Science, Computer Engineering, or equivalent practical experience.</li><li style="box-sizing: inherit; outline: 0px !important; text-indent: -17px;">Experience with one or more public cloud platforms, including infrastructure, storage, platforms.</li><li style="box-sizing: inherit; outline: 0px !important; text-indent: -17px;">Experience in advanced areas of networking, including Linux, software-defined networking, network virtualization, open protocols, application acceleration and load balancing, DNS, virtual private networks and their application to PaaS and IaaS technologies.</li><li style="box-sizing: inherit; outline: 0px !important; text-indent: -17px;">Experience with deployment methodologies and technologies (CI/CD, Chef, Puppet, Ansible etc).</li><li style="box-sizing: inherit; outline: 0px !important; text-indent: -17px;">Experience with Windows, Linux system administration, and/or Enterprise applications.</li></ul></div>', NULL, 64, 77, 79, NULL, 'Full Time Employee', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '800000', 'VM Migration Engineer', 2, NULL, NULL, NULL, NULL, '2019-06-01', NULL, NULL, NULL, 1, 0, NULL, 0, NULL, NULL, 0, NULL, NULL, 0, NULL, 0, NULL, 0, NULL, 0, NULL, '2019-05-13 17:21:10', '2019-05-24 04:05:07', '', '', 'Mid Career', 0, 5, NULL, 1, NULL, NULL, NULL),
